import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material';

export default function TopNavBar() {
    
    return (
        <AppBar 
            position="static"
            style={{ backgroundColor: '#f4f1ec' }}>
            <Toolbar>
                <Typography 
                    variant="h6" 
                    component="div" 
                    sx={{ 
                        flexGrow: 1, 
                        fontFamily: "EB Garamond",
                        fontWeight: 600,
                        color: '#1b1c1c'
                    }}
                >
                    Journal++
                </Typography>
                
                {/* Add more items to the right side of the toolbar */}
            </Toolbar>
        </AppBar>
    );
}
